BEGIN TRANSACTION;

-- Table: src_client_snapshot
CREATE TABLE src_client_snapshot (
  cliente_id   INTEGER NOT NULL,
  nome         TEXT NOT NULL,
  cidade       TEXT,
  estado       TEXT,
  segmento     TEXT,
  updated_at   TEXT NOT NULL
);


-- Table: src_account_snapshot
CREATE TABLE src_account_snapshot (
  account_id   INTEGER NOT NULL,
  cliente_id   INTEGER NOT NULL,
  tipo         TEXT NOT NULL,
  status       TEXT NOT NULL,
  updated_at   TEXT NOT NULL
);


-- Table: src_cdb_produto
CREATE TABLE src_cdb_produto (
  produto_id     INTEGER PRIMARY KEY,
  nome           TEXT NOT NULL,
  emissor        TEXT NOT NULL,
  indexador      TEXT NOT NULL,
  percentual     REAL,
  taxa_aa        REAL,
  ipca_spread    REAL,
  prazo_dias     INTEGER NOT NULL,
  liquidez       TEXT NOT NULL,
  investimento_minimo REAL NOT NULL
);


-- Table: src_cdb_ordem
CREATE TABLE src_cdb_ordem (
  ordem_id      INTEGER NOT NULL,
  account_id    INTEGER NOT NULL,
  cliente_id    INTEGER NOT NULL,
  produto_id    INTEGER NOT NULL,
  tipo          TEXT NOT NULL,        -- 'COMPRA' | 'VENDA'
  quantidade    REAL NOT NULL,
  preco_unit    REAL NOT NULL,
  valor_total   REAL NOT NULL,
  status        TEXT NOT NULL,        -- 'PROCESSING' | 'EXECUTADA' | 'CANCELADA' | 'REJEITADA'
  created_at    TEXT NOT NULL,        -- ISO8601 TIMESTAMP
  updated_at    TEXT NOT NULL,        -- ISO8601 TIMESTAMP (when this status was written)
  PRIMARY KEY (ordem_id, created_at)  -- allow multiple timeline rows per order
);


-- Table: dwh_dim_tempo
CREATE TABLE dwh_dim_tempo (
  dt_id         INTEGER PRIMARY KEY,
  data          TEXT NOT NULL,
  ano           INTEGER NOT NULL,
  mes           INTEGER NOT NULL,
  dia           INTEGER NOT NULL,
  nome_mes      TEXT NOT NULL,
  dia_da_semana INTEGER NOT NULL
);


COMMIT;
